import React from "react";
import Container from "@mui/material/Container";

export default function Login() {
  return (
    <Container
      maxWidth="sm"
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        height: "100vh",
      }}
    >
      <button>Click me</button>
    </Container>
  );
}
